import React from 'react';

const NavBar = () => { 
  return (
    <div className="container">
      <nav>
        <div className="title">E-BILLING APP</div>
        <div className="nav-buttons">
          <a href="/login">LOG OUT</a>
        </div>
      </nav>
    </div>
  );
};

export default NavBar;
